define('joystickTransport',['views/joystick'],function(joystick) {
    return function JoystickTransport(args) {
        this.address   = args.address;
        this.session   = args.session;
        this.constants = args.constants;

        this.angle = 1;
        this.socket = null;
        this.queryInterval = null;
        this.isMoving = false;

        this.initialize = function() {
            joystick.on("setAngle", this.onSetAngle.bind(this));
            joystick.on("stopMove", this.onStop.bind(this));
            joystick.on("startMove", this.onStart.bind(this));
            this.socket = new WebSocket(this.constants.get("SOCKET_HOST") + "/" + this.address);
            this.socket.onopen = function(event) {
                console.log("____ open socket");
                this.setQueryInterval();
            }.bind(this);
            this.socket.onmessage = function(event) {
                console.log("getted : ");
                console.log(event.data);
            }.bind(this);
            this.socket.onclose = function(event) {
                console.log("____ close socket");
            };
        };

        this.onSetAngle = function(data) {
            this.angle = data.angle;
        };

        this.onStop = function() {
            this.isMoving = false;
        };

        this.onStart = function() {
            this.isMoving = true;
        };

        this.setQueryInterval = function() {
            this.queryInterval = setInterval(this.sendMessage.bind(this), this.constants.get('INTERVAL_SHORT'));
        };

        this.sendMessage = function() {
            //console.log("____send");
            //console.log("angle : " + this.angle + " isMoving : " + this.isMoving);
            var data = JSON.stringify({"direction": this.angle, "isMoving": this.isMoving, "session": this.session});
            this.socket.send(data);
        };

        this.exit = function() {
            console.log("joystick transport exit");
            clearInterval(this.queryInterval);
            this.socket.close();
        }

    }
});
define('views/characters/character',[
    'backbone'
], function(
    Backbone
){

    return Backbone.View.extend({
        tagName: 'canvas',
        color: '#f90',
        borderColor: '#002',
        context: null,
        canvas: null,
        initCanvas: function(args) {
            document.getElementById('page').appendChild(this.el);
            this.canvas = this.el;
            this.canvas.width = args.width;
            this.canvas.height = args.height;
            this.context = this.canvas.getContext('2d');
        },
        draw: function() {
            if (this.context != null) {
                this.clear();
                var posX = this.model.get('posX');
                var posY = this.model.get('posY');
                var radius = this.model.get('radius');
                var color = this.color;
                var borderColor = this.borderColor;
                var name = this.model.get('name');
                var score = this.model.get('score');
                this.context.beginPath();
                //тень____________________
                this.context.shadowBlur = radius;
                this.context.shadowColor = color;
                //________________________
                //основной круг___________
                this.context.fillStyle = color;
                this.context.arc(posX, posY, radius, 0, 2 * Math.PI, true);
                this.context.fill();
                //________________________
                //граница круга___________
                this.context.strokeStyle = borderColor;
                this.context.arc(posX, posY, radius, 0, 2 * Math.PI, true);
                this.context.stroke();
                //________________________
                //имя_____________________
                this.context.shadowBlur = 18;
                this.context.shadowColor = '#f5f5f5';
                this.context.fillStyle = '#f5f5f5';
                this.context.font = 'normal 18px NunitoNormal';
                this.context.fillText(name, posX + radius + 5, posY - 3);
                //________________________
                //счет____________________
                this.context.font = 'normal 24px NunitoNormal';
                this.context.fillText(score, posX + radius + 5, posY + 18);
                //________________________
            }
        },

        clear: function() {
            //посреди игрового цикла может обнулиться
            if (this.context != null) {
                this.context.beginPath();
                var x = this.model.get('posX');
                var y = this.model.get('posY');
                var r = this.model.get('radius');
                var s = this.model.get('speed');
                this.context.clearRect(x - r * 2 - 20, y - r * 2 - 30, 6 * r + 100, 6 * r + 30);
            }
        },

        clearAll: function(fieldWidth, fieldHeight) {
            this.context.clearRect(0, 0, fieldWidth, fieldHeight);
        },

        deleteCanvas: function() {
            if (this.el.parentNode != null) {
                document.getElementById("page").removeChild(this.el);
            }
            this.canvas = null;
            this.context = null;
        }
    });
});
define('models/characters/character',[
    'backbone'
], function(
    Backbone
){

    return Backbone.Model.extend({
        defaults: {
            posX: undefined,
            posY: undefined,
            radius: 20,
            name: undefined,
            gameScore: 0,
            speed: 200,
            angle: 0, //направление движения
            visible: false,
            isMoving: false
        },
        move: function (dt) {
            //console.log("MOVE : X : " + this.get('posX') + "; Y :  " + this.get('posY') + "; Angle : " + this.get('angle'));
            if (this.get('isMoving') == true) {
                var dl = this.get('speed') * dt;
                var posX = this.get('posX') + Math.cos(this.get('angle') * (Math.PI / 180)) * dl;
                var posY = this.get('posY') - Math.sin(this.get('angle') * (Math.PI / 180)) * dl;
                this.set({'posX': posX});
                this.set({'posY': posY});

            }
        }
    });
});
define('models/characters/myCharacter',[
    'backbone',
    'models/characters/character',
    'constants'
], function(
    Backbone,
    CharacterModel,
    constants
){

    return CharacterModel.extend({
        mouseX: 0,
        mouseY: 0,
        calculateAngle: function (x, y) {
            var angle = Math.atan((this.get('posY') - y) / (x - this.get('posX')));
            angle = angle * (180 / Math.PI);
            if (x < this.get('posX')) {
                angle += 180;
            }
            angle = (angle + 360) % 360;
            this.set({"angle": angle});
        },
        setMouseCoordinate: function (x, y) {
            this.mouseX = x - constants.get("X_OFFSET_TO_CANVAS");
            this.mouseY = y - constants.get("Y_OFFSET_TO_CANVAS");
            //console.log("setted mouseX : " + this.mouseX + "; mouseY : " + this.mouseY + "  offsetX : ");

        },
        calculateDistanceToMouse: function (x, y) {
            return Math.sqrt((this.get('posX') - x) * (this.get('posX') - x) + (this.get('posY') - y) * (this.get('posY') - y));
        },
        myMove: function (dt) {
            //console.log("MYMOVE : X : " + this.posX + "; Y :  " + this.posY + "; Angle : " + this.angle);
            //this.set({'isMoving': true});
            if (this.calculateDistanceToMouse(this.mouseX, this.mouseY) > this.get('radius')) {
                //this.calculateAngle(this.mouseX, this.mouseY);
                this.move(dt);
            } else {
                this.set({'isMoving': false});
            }
        }
    });
});
